    designation of the $1,000 contribution on 5/29/08 for Friends of Chris Dodd to
    the 2010 Primary.  We inadvertently designated the election for the 2008 Primary.
    \ All other aspects of this report remain unchanged. The contra disbursements
    reported on Line 21b of this report and transferred to Line 24 relate to an original
    $7,500.00 advance payment made to the National Association of Realtors (NAR) for
    consulting services on 9/15/2006 and reported on Line 21b of the October 2006
    monthly report. Subsequently in 2006 & 2008, we utilized $6,350.00 of this advanced
    payment as consulting services attributable to independent expenditures and reflected
    as negative amounts subtracted from Line 21b and transferred to Line 24. $400.00
    of the original $7,500.00 is being utilized as consulting services attributable
    to an independent expenditure on behalf of Monty Newman on the June 2008 monthly
    report.  For Line 22 of this report, note the following entries are refunds for
    contributions received by this committee that were unacceptable. Each entry we
    reference contains the payee, date & amount of disbursement, along with the original
    date of receipt. The following contributions represented by the refunds are reported
    as unitemized on the 6/20/08 monthly report:  Louisiana RPAC $64.65 on 5/16/08
    orig recd 5/05/08; Washington DC RPAC $210.00 on 5/22/08 orig recd 5/14/08; New
